import styled from 'styled-components';
import './Home.css';

import React from 'react';
import logo from "./spoti.png";
import { Link } from 'react-router-dom';



const StyledImg = styled.img`
  width: 150px;


`;




function Home() {
  return (
    <div className='home'>
      <StyledImg src={logo} alt="Logo"></StyledImg>
      <div className='home2'>
      <a href="1">Artists</a>
      <Link to='/albums/10'>Albums</Link>
      <a href="3">Genres</a>
      <a href="4">Tracks</a>
      <a href="5">Albums genres</a>
      </div>
      <div className='img'>
      </div>
      </div>


  )

}



export default Home;
